CREATE TABLE IF NOT EXISTS `audit_logs` (
  `id` int AUTO_INCREMENT NOT NULL,
  `userId` int,
  `action` varchar(100) NOT NULL,
  `entityType` varchar(50) NOT NULL,
  `entityId` int,
  `changes` json,
  `metadata` json,
  `ipAddress` varchar(45),
  `userAgent` text,
  `createdAt` timestamp NOT NULL DEFAULT (now()),
  CONSTRAINT `audit_logs_id` PRIMARY KEY(`id`),
  CONSTRAINT `audit_logs_userId_users_id_fk` FOREIGN KEY (`userId`) REFERENCES `users`(`id`)
);

CREATE INDEX IF NOT EXISTS `user_id_idx` ON `audit_logs` (`userId`);
CREATE INDEX IF NOT EXISTS `action_idx` ON `audit_logs` (`action`);
CREATE INDEX IF NOT EXISTS `entity_idx` ON `audit_logs` (`entityType`, `entityId`);
CREATE INDEX IF NOT EXISTS `created_at_idx` ON `audit_logs` (`createdAt`);

